script: |
  super -f text -I q7625.spq | sort > q7625.out

inputs:
  - name: q7625.spq
    data: |
      SELECT DISTINCT - col0 * - ( + col1 ) * - + col0 AS col1, + 60 * + 5 + - 14 * - - col1 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE col2 * - 20 IN ( - col2 );
  - name: tab2

outputs:
  - name: q7625.out
    data: |
